window.bookSummaryJSON = "<p>Hunting for the bad guys has never been so dangerous...</p> <p>My name is Rory Forseti, and I attend the Colorado branch of Mythos Academy, a school of warrior kids, powerful artifacts, and mythological monsters.</p> <p>I'm a student, a fierce Spartan warrior, and a member of Team Midgard, a group of kids and adults tasked with stopping the evil Reapers of Chaos. There is one Reaper I'm determined to hunt down above all others: Covington, the man who murdered my parents.</p> <p>So when the Midgard gets a tip that Covington is going to try to steal a dangerous artifact, I'm ready to fight. But the situation is far more complicated than it seems, and the Reapers aren't my only enemies.</p> <p>I'll have to use all my Spartan strength and skills to survive this. And even then, it might be my blood that gets spilled....</p>"; 
